import './vidPlayer.scss';


function vidPlayer(props) {
  return (
    <section className="selectVidSec">
        <video poster={props.selectedVideo.image} alt={`${props.selectedVideo.title} Movie Poster`} controls className="selectVidSec__video">
          Your browser does not support the video tag.
        </video>
    </section>
  )
}

export default vidPlayer;
